const customer = {};

customer.create = async (username, password) => {

  const datapost = {
    username: username,
    password: password,
  }

  const res = await fetch("http://localhost:8080/foodpanda/customer",datapost)
  .then(response=>{ return response.data; })
  console.log(response)
  
  return res;
}

export default customer
